							$('#cc2').html('<strong>'+toThousands(trend[platform]['t5'][0])+'</strong>');
						}
						var y = sum1-sum;
						$('#f_'+(i+5)).html('<strong>'+toThousands(sum)+'</strong>');
						if(sum1-sum<0){
							$('#b_'+(i+5)).html('<span class="change-up"><font>'+x+'</font><font style="display:none">'+(-y)+'</font><i class="ico-up"></i></span>');
						}else if(sum1-sum>0){
							$('#b_'+(i+5)).html('<span class="change-down"><font>'+x+'</font><font style="display:none">'+y+'</font><i class="ico-down"></i></span>');
						}else{
							$('#b_'+(i+5)).html('<span><font>'+x+'</font><font style="display:none">'+y+'</font><i class="ico-unbiased"></i></span>');
						}
					}
					if(axisline){mobileChartPie.setOption(option2);}
					c[platform] = 1;
				}
			}
		}
	}
	function showChart(platform){
		var cur = '';
		var arr = ['pc','mobile'];
		for(var i=0; i<arr.length; i++){
			if($('#btn-'+arr[i]).hasClass('active')){
				cur = arr[i];
			}
		}
		if(cur==''){
			$('#btn-'+platform).addClass('active');
			$('#tit-'+platform).addClass('active');
			$('#chart-'+platform).slideDown();
		}else{
			if(cur==platform){
				$('#btn-'+platform).removeClass('active');
				$('#tit-'+platform).removeClass('active');
				$('#chart-'+platform).slideUp();
			}else{
				$('#btn-'+cur).removeClass('active');
				$('#tit-'+cur).removeClass('active');
				$('#btn-'+platform).addClass('active');
				$('#tit-'+platform).addClass('active');
				$('#chart-'+cur).hide();
				$('#chart-'+platform).show();
			}
		}
	}
	function showmore(type){
		var has = false;
		if($('#dl-'+type).hasClass('active')){
			has = true;
		}
		$('#dl-sub').removeClass('active');
		$('#dl-same').removeClass('active').removeAttr('style');
		if(!has){
			$('#dl-'+type).addClass('active');
			if(type=='sub'){
				$('#dl-same').css('marginTop','108px');
			}
		}
	}
</script>
